requests.postData:
[{"variables":{"channelLogin":"fafa89","isEmbedded":true},"extensions":{},"operationName":"ChatInput","query":"query ChatInput($channelLogin: String!, $isEmbedded: Boolean!) {
  currentUser {
    id
    bitsBalance
    isPartner @include(if: $isEmbedded)
    __typename
  }
  user(login: $channelLogin) {
    id
    cheer {
      id
      hashtags {
        edges {
          cursor
          node {
            id
            __typename
          }
          __typename
        }
        __typename
      }
      settings {
        emoteMinimumBits
        cheerMinimumBits
        event
        __typename
      }
      __typename
    }
    __typename
  }
}
"},{"variables":{"channelLogin":"fafa89"},"extensions":{},"operationName":"ChatList_Badges","query":"query ChatList_Badges($channelLogin: String!) {
  badges {
    ...badge
    __typename
  }
  user(login: $channelLogin) {
    id
    broadcastBadges {
      ...badge
      __typename
    }
    self {
      selectedBadge {
        ...badge
        __typename
      }
      displayBadges {
        ...badge
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment badge on Badge {
  id
  setID
  version
  title
  image1x: imageURL(size: NORMAL)
  image2x: imageURL(size: DOUBLE)
  image4x: imageURL(size: QUADRUPLE)
  clickAction
  clickURL
  __typename
}
"},{"variables":{"channelLogin":"fafa89"},"extensions":{},"operationName":"ChatList_Bits","query":"query ChatList_Bits($channelLogin: String!) {
  user(login: $channelLogin) {
    id
    ...cheer
    __typename
  }
}

fragment cheer on User {
  cheer {
    id
    emotes {
      id
      prefix
      type
      tiers {
        id
        bits
        color
        images {
          id
          url
          theme
          isAnimated
          dpiScale
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  __typename
}
"},{"variables":{"channelLogin":"fafa89"},"extensions":{},"operationName":"Chat_ChannelData","query":"query Chat_ChannelData($channelLogin: String!) {
  channel: user(login: $channelLogin) {
    id
    login
    displayName
    chatSettings {
      blockLinks
      rules
      chatDelayMs
      __typename
    }
    self {
      isModerator
      __typename
    }
    __typename
  }
}
"},{"variables":{},"extensions":{},"operationName":"TrackingManager_RequestInfo","query":"query TrackingManager_RequestInfo {
  requestInfo {
    countryCode
    ipAddress
    __typename
  }
}
"}]

[{"variables":{"channelOwnerID":"127160075"},"extensions":{},"operationName":"EmotePicker_EmotePicker_UserSubscriptionProducts","query":"query EmotePicker_EmotePicker_UserSubscriptionProducts($channelOwnerID: ID!) {
